		"id_str": "984475549283135488",
		"text": "\"앞선 곡들이 사재기로 의심 받지 않는 것은 이러한 자신들만의 서사가 존재했기 때문이다. 차트가 돌아가는 상황에 대해 세세하게 잘 모르는 일반인이라 하더라도 ‘저 정도 인기 있고 주목 받았으면 저만큼 순위 높을 만하지’라고 인정할 서사 말이다.\"",
